import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import FilterComponent from './FilterComponent';
import ChartComponent from './ChartComponent';
import './New.css';  // Add this line to import Dashboard-specific styles


const New = () => {
  return (
    <Container fluid>
      <Row>
        <Col xs={3}>
          <FilterComponent />
        </Col>
        <Col xs={9}>
          <Row>
            <Col><ChartComponent title="Weight vs Age" /></Col>
            <Col><ChartComponent title="Live Weights Over Time" /></Col>
          </Row>
          <Row>
            <Col><ChartComponent title="Live Weight" /></Col>
            <Col><ChartComponent title="Daily Live Weight Gain" /></Col>
          </Row>
        </Col>
      </Row>
    </Container>
  );
};

export default New;
